import React, { useState } from "react";
import Task from "./Task";

export default function TasksCont({ tasks }) {
  return (
    <div className="tasks-container">
      <ul>
        {tasks.map((task) => (
          <Task taskData={task} />
        ))}
      </ul>
      <div className="controls">
        <span>items left</span>
        <ul>
          <li>All</li>
          <li>Active</li>
          <li>Completed</li>
        </ul>
        <button>Clear Completed</button>
      </div>
    </div>
  );
}
